import React from 'react';
import { MyContext } from './../../../App'


function ToDodata() {

    return (
        <MyContext.Consumer>
            {value => (

                <>
                    <div className="ListItems">
                        <span className="name title">Task Name</span>
                        <span className="action title">Delete</span>
                        <span className="action title">Complete</span>
                        {
                            value.allData.map(item => {
                                return (
                                    <div key={item.id}>
                                        <span className="name ">{item.name}</span>
                                        <span className="action icon" onClick={this.handleDelete(value.deleteItem)}>&times;</span>
                                        <span className="action icon" onClick={() => value.doneItem(item.id)}>&radic;</span>
                                    </div>
                                )
                            })
                        }
                    </div>
                </>

            )}
        </MyContext.Consumer>


    )
}

export default ToDodata;
